import React from 'react';

const ChildComponent = () => {
  // Function in the child component
  const childFunction = () => {
    document.write("Function called from ChildComponent");
  };

  return (
    <div>
      <h2>Child Component</h2>
    </div>
  );
};

const RentalForm = () => {
  // Call the child function directly
  const callChildFunction = () => {
    ChildComponent.childFunction();
  };

  return (
    <div>
      <h1>Parent Component</h1>
      <button onClick={callChildFunction}>Call Child Function</button>
      <ChildComponent />
    </div>
  );
};

export default RentalForm;
